//import http from '../StarwarsAPI'
import Axios from 'axios'

const URL = 'https://swapi.dev/api/'
const StarwarsAPI = Axios.create({
    baseURL: URL
})
const http=StarwarsAPI
const getDataLuke =()=>{
    return StarwarsAPI.http.get('people/1/')
}
const getStarwarsCharacter=(characterNumber)=>{
    return StarwarsAPI.http.get(`/people/${characterNumber}`)
}

export default {
    getStarwarsCharacter
}
